import { useDispatch,useSelector } from 'react-redux'
import { getPosts } from './postsSlice'

const Posts = () => {
  const dispatch = useDispatch()
  const { posts } = useSelector(state => state.posts)
  
  useEffect(() => {
    dispatch(getPosts({ limit: 5 }))
  }, [dispatch])

  return (
    <div>
      <h1>posts...</h1>
    </div>
  )
}

export default Posts
